import React from 'react';
// import { ResponsiveContainer } from 'recharts';
import Title from './Title';
import { List, ListItem, ListItemText } from '@material-ui/core';
import { AdminServicesList, BillingAndUsage } from './listItems';
import { Typography, Grid, Box } from '@material-ui/core';
import AppsIcon from '@material-ui/icons/Apps';



export default function adminServices() {

    return (
        <React.Fragment>
          <Title>Admin Services</Title>
            <ListItem>
                <Grid container direction="row" alignItems="center" alignContent="flex-start" maxWidth='xl' margin-left='0'>
                    <Grid item>
                        <AppsIcon fontSize="large"/>
                    </Grid>
                    <Grid item>
                        <Typography component="div">
                        <Box fontWeight="fontWeightBold" fontSize="h6.fontSize" m={1}>
                            Application Management
                        </Box>
                        </Typography>
                    </Grid>
                </Grid> 
            </ListItem>
            <ListItem>
                <List>{AdminServicesList}</List>
            </ListItem>
            <ListItem>
                <List>{BillingAndUsage}</List>
            </ListItem>
        </React.Fragment>
      );
}
